import React from "react";
import API from "../utils/API";

const ViewStats = () => {

    const showData = (evt) => {
        evt.preventDefault();
        API.getStats()
        .then(res => updateStats())
        .catch(err => console.log(err));
    }

    const updateStats = () => {
        API.saveStats();
    }

    return (
        <div>
            <h3>Player Stats</h3>
            <p>Player Name</p>
            <p>Wins</p>
            <button onClick={showData}>Data</button>
        </div>
    )
}

export default ViewStats;
